    <body>
      <div class="login-root">
        <div
          class="box-root flex-flex flex-direction--column"
          style="min-height: 100vh; flex-grow: 1"
        >
          <div class="loginbackground box-background--white padding-top--64">
            <div class="loginbackground-gridContainer">
              <div
                class="box-root flex-flex"
                style="grid-area: top / start / 8 / end"
              >
                <div
                  class="box-root"
                  style="
                    background-image: linear-gradient(
                      white 0%,
                      rgb(247, 250, 252) 33%
                    );
                    flex-grow: 1;
                  "
                ></div>
              </div>
              <div class="box-root flex-flex" style="grid-area: 4 / 2 / auto / 5">
                <div
                  class="box-root box-divider--light-all-2 animationLeftRight tans3s"
                  style="flex-grow: 1"
                ></div>
              </div>
              <div
                class="box-root flex-flex"
                style="grid-area: 6 / start / auto / 2"
              >
                <div
                  class="box-root box-background--blue800"
                  style="flex-grow: 1"
                ></div>
              </div>
              <div
                class="box-root flex-flex"
                style="grid-area: 7 / start / auto / 4"
              >
                <div
                  class="box-root box-background--blue animationLeftRight"
                  style="flex-grow: 1"
                ></div>
              </div>
              <div class="box-root flex-flex" style="grid-area: 8 / 4 / auto / 6">
                <div
                  class="box-root box-background--gray100 animationLeftRight tans3s"
                  style="flex-grow: 1"
                ></div>
              </div>
              <div
                class="box-root flex-flex"
                style="grid-area: 2 / 15 / auto / end"
              >
                <div
                  class="box-root box-background--cyan200 animationRightLeft tans4s"
                  style="flex-grow: 1"
                ></div>
              </div>
              <div
                class="box-root flex-flex"
                style="grid-area: 3 / 14 / auto / end"
              >
                <div
                  class="box-root box-background--blue animationRightLeft"
                  style="flex-grow: 1"
                ></div>
              </div>
              <div
                class="box-root flex-flex"
                style="grid-area: 4 / 17 / auto / 20"
              >
                <div
                  class="box-root box-background--gray100 animationRightLeft tans4s"
                  style="flex-grow: 1"
                ></div>
              </div>
              <div
                class="box-root flex-flex"
                style="grid-area: 5 / 14 / auto / 17"
              >
                <div
                  class="box-root box-divider--light-all-2 animationRightLeft tans3s"
                  style="flex-grow: 1"
                ></div>
              </div>
            </div>
          </div>
          <div
            class="box-root padding-top--24 flex-flex flex-direction--column"
            style="flex-grow: 1; z-index: 9"
          >
            <div
              class="box-root padding-top--48 padding-bottom--24 flex-flex flex-justifyContent--center"
            ></div>
            <h1 class="h1-h1" style="text-align: center">
              <a href="http://blog.stackfindover.com/" rel="dofollow" class="a-a"
                >Star-buy</a
              >
            </h1>
            <div class="formbg-outer">
              <div class="formbg">
                <div class="formbg-inner padding-horizontal--48">
                  <span class="padding-bottom--15">Sign in to your account</span>
                  <div id="stripe-login">
                    <div class="field padding-bottom--24">
                      <label class="label-label" for="email">Email</label>
                      <input
                        class="input-input"
                        type="email"
                        name="email"
                        placeholder="@gmail.com"
                       
                      />
                    </div>
                    <div class="field padding-bottom--24">
                      <div class="grid--50-50">
                        <label class="label-label" for="password" >Password</label>
                        <div class="reset-pass">
                          <a class="a-a" href="#">Forgot your password?</a>
                        </div>
                      </div>
                      <input
                        class="input-input"
                        type="password"
                        name="password"
                        placeholder="Put your password..."
                       
                      />
                    </div>
                    <div
                      class="field field-checkbox padding-bottom--24 flex-flex align-center"
                    ></div>
                    <div class="field padding-bottom--24">
                      <button
                        class="input-input"
                        type="submit"
                        name="submit"
                       
                      >
                        Continue</button
                      ><br />
  
                      <!-- <router-link>hello</router-link> -->
                    </div>
                    <div class="field"></div>
                  </div>
                </div>
              </div>
            <div class="namedata" > sirine</div> 
              <img src= />
              <div class="footer-link padding-top--24">
         
                <div
                  class="listing padding-top--24 padding-bottom--24 flex-flex center-center"
                >
                  <span class="span-span"
                    ><a href="#" class="a-a">Contact</a></span
                  >
                  <span class="span-span"
                    ><a href="#" class="a-a">Privacy & terms</a></span
                  >
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </body>
